import { useState } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebook, faWhatsapp, faTelegram } from '@fortawesome/free-brands-svg-icons'
import { faCoffee,faFacebookF } from '@fortawesome/free-solid-svg-icons';

const Social = () => {
  return (
    <div className="social-buttons">
    <a href="https://google.com">
   <FontAwesomeIcon icon={faWhatsapp} className="social-icon facebook"/></a>
    <FontAwesomeIcon icon={faFacebook} className="social-icon whatsapp" />
    <FontAwesomeIcon icon={faTelegram} className="social-icon telegram" />
    </div>
    )
}

export default Social
